// ==UserScript==
// @name			Oh My Fonts
// @namespace		http://tampermonkey.net/
// @version			0.5.2
// @description		Change web fonts.
// @author			wootommy
// @match			*://*/*
// @icon			data:image/png;base64,
// @run-at 			document-idle
// @grant			unsafeWindow
// @license MIT
// @downloadURL https://update.greasyfork.org/scripts/445073/Oh%20My%20Fonts.user.js
// @updateURL https://update.greasyfork.org/scripts/445073/Oh%20My%20Fonts.meta.js
// ==/UserScript==

/* --------------------------------- script --------------------------------- */

const main = () => {
	const fontList = [
			"'SF Pro'",
			"'SF Pro Text'",
			"'SF Pro Display'",
			"'Segoe UI'",
			"'Segoe'",
			"'HarmonyOS Sans'",
			"'PingFang SC'",
			"'Microsoft YaHei'",
			"'HarmonyOS Sans SC'",
			"'Apple Legacy Chevron'",
			"'Apple Color Emoji'",
			"'Segoe UI Symbol'",
			"'Segoe UI Emoji'",
		],
		codeFontList = [
			"ui-monospace",
			"'SFMono-Regular'",
			"'SF Mono'",
			"'Menlo'",
			"'Courier New'",
			"'Courier'",
			"'Consolas'",
			"'Liberation Mono'",
			"monospace",
		]

	const codeElements = ["code", "pre", "tt", "xmp"],
		codeClasses = [
			".notion-enable-hover",
			".blob-code-content",
			".notion-code-block",
		],
		codeAttrs = [],
		codeIDs = []

	const excludeElements = ["i", "fa"],
		excludeClasses = [],
		excludeAttrs = [
			"[content*='/']",
			"[class*='i']",
			"[class*='fa']",
			"[class*='tex']",
			"[class*='latex']",
			"[class*='jax']",
			"[class*='math']",
			"[class*='mjx']",
		],
		excludeIDs = []

	const includeElements = ["h1", "h2", "h3", "h4", "h5", "h6"],
		includeAttrs = [
			"[class*='caption']",
			"[class*='toctree']",
			"[class*='btn']",
		],
		includeClasses = [".markdown-body"],
		includeIDs = ["#readme"]

	const generateFilterStr = (list = [], depth = 5) => {
		if (list.length == 0) return ""
		const filter = []
		list.map((v) => {
			for (let j = 0; j < depth; j++) {
				filter.push(v + new Array(j + 1).join(">*"))
			}
		})
		return filter.join(",")
	}

	const generateStyleStr = (filter, attr, value) => {
		return filter + "{" + attr + ":" + value + "!important;}"
	}

	const addStyle = (delayTime = 0) => {
		const allStyle = [
				generateStyleStr(
					"*:where(*:not(" +
						generateFilterStr(
							[]
								.concat(codeElements)
								.concat(codeClasses)
								.concat(codeAttrs)
								.concat(codeIDs)
								.concat(excludeElements)
								.concat(excludeClasses)
								.concat(excludeAttrs)
								.concat(excludeIDs)
						) +
						"))",
					"font-family",
					fontList.join(",")
				),
				generateStyleStr(
					"*:where(" +
						generateFilterStr(
							[]
								.concat(codeElements)
								.concat(codeClasses)
								.concat(codeAttrs)
						) +
						"):not(" +
						generateFilterStr(
							[]
								.concat(excludeElements)
								.concat(excludeClasses)
								.concat(excludeAttrs)
								.concat(excludeIDs)
						) +
						"))",
					"font-family",
					codeFontList.join(",")
				),
				generateStyleStr(
					"*:where(:where(" +
						generateFilterStr(
							[]
								.concat(includeElements)
								.concat(includeClasses)
								.concat(includeAttrs)
						) +
						"):not(" +
						generateFilterStr(
							[]
								.concat(codeElements)
								.concat(codeClasses)
								.concat(codeAttrs)
								.concat(codeIDs)
						) +
						"))",
					"font-family",
					fontList.join(",")
				),
				generateStyleStr(
					"*:is(" +
						generateFilterStr(codeIDs) +
						"):not(" +
						generateFilterStr(
							[]
								.concat(excludeElements)
								.concat(excludeClasses)
								.concat(excludeAttrs)
								.concat(excludeIDs)
						) +
						"))",
					"font-family",
					codeFontList.join(",")
				),
				generateStyleStr(
					"*:is(:where(" +
						generateFilterStr(includeIDs) +
						"):not(" +
						generateFilterStr(
							[]
								.concat(codeElements)
								.concat(codeClasses)
								.concat(codeAttrs)
								.concat(codeIDs)
						) +
						"))",
					"font-family",
					fontList.join(",")
				),
			],
			weightStyle = "",
			// weightStyle = "*{font-weight:normal!important;}",
			// weightStyle = "*{font-weight:normal;}",
			allStyleStr = allStyle.join("")

		console.log(allStyleStr)
		setTimeout(() => {
			const style = document.createElement("style")
			style.innerHTML = allStyleStr
			document.body.appendChild(style)
		}, delayTime)
	}

	// run
	addStyle(0)
}

/* --------------------------------- runtime -------------------------------- */

;(() => {
	"use strict"
	main()
})()